const ticketDetails = ({currentUser,ticket})=>{


    const tableContent = tickets.map(t=>{
            return (
                <tr key={t.id}>
                    <td>{t.title}</td>
                    <td>{t.price}</td>
                </tr>
            );
        });



    return (
            <div>
                <h1>Tickets</h1>
                <table className="table">
                    <thead>
                        <tr>
                            <th>Title</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {tableContent}
                    </tbody>
                </table>
            </div>
        );
}; 




